import './App.css';

class App extends React.Component{
  constructor(props) {
    super(props);
    this.state = {
      nr: '',
    };
  }

  handleChange = event => {
    this.setState({ nr: event.target.value });
  };

  render(){
    console.log(this.state.nr)
  return (
        <div style={{margin:40}}>
          <form onSubmit={this.submit}>
            <label>
              CUI:
              <input type="text" name='cui' value={this.state.nr} maxLength={9} onChange={this.handleChange}/>
            </label>
            <input type="submit" value="Submit"  />
          </form>

          <h3>Your nr is: {this.state.nr}</h3>
        </div>
  );
}
}

export default App;
